import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

import { makeStyles } from "@material-ui/core/styles";

import TextField from "@material-ui/core/TextField";
import { Formik } from "formik";

const useStyles = makeStyles({
  root: {
    background: "linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)",
    border: 0,
    borderRadius: 3,
    boxShadow: "0 3px 5px 2px rgba(255, 105, 135, .3)",
    color: "white",
    height: 48,
    padding: "0 30px",
  },
});

const initialValues = {
  email: "",
  password: "",
};

const Index = () => {
  return (
    <div>
      <Box
        style={{
          marginTop: "10%",
          marginLeft: "450px",
          borderRadius: "5px",
          width: "350px",
          height: "340px",
          backgroundColor: "#F7F7F7",
        }}
      >
        <Box
          style={{
            paddingTop: "25px",
            marginBottom: "10 px",
            textAlign: "center",
          }}
        >
          <Typography style={{ fontSize: "35px", textAlign: "center" }}>
            Log in
          </Typography>
        </Box>

        <Formik
          initialValues={initialValues}
          onSubmit={(values, { resetForm }) => {
            console.log(values);
          }}
        >
          {({
            values,
            handleChange,
            handleBlur,
            handleSubmit,
            errors,
            touched,
          }) => {
            console.log(values);
            return (
              <Box>
                <Box style={{ marginLeft: "65px  " }}>
                  <Typography>Email:</Typography>
                  <Input
                    name="email"
                    style={{
                      backgroundColor: "#ffffff",
                      border: "1px solid #CCCCCC",
                      borderBottom: "1px solid #CCCCCC",
                      borderRadius: "4px",
                      padding: "0px 10px",
                    }}
                    value={values.email}
                    onChange={handleChange}
                    placeholder="Enter your Email"
                  />
                </Box>
                <Box style={{ marginLeft: "65px ", marginTop: "15px" }}>
                  <Typography type="password">Password:</Typography>
                  <Input
                    name="password"
                    type="password"
                    style={{
                      backgroundColor: "#ffffff",
                      border: "1px solid #CCCCCC",
                      borderBottom: "1px solid #CCCCCC",
                      borderRadius: "4px",
                      padding: "0px 10px",
                    }}
                    value={values.password}
                    onChange={handleChange}
                    placeholder="Enter your Password "
                  />
                </Box>
                <Box style={{ marginLeft: "65px" }}>
                  <Button
                    style={{
                      marginTop: "50px",
                      backgroundColor: "#347AB7",
                      color: "white",
                      width: "80%",
                    }}
                    variant="contained"
                  >
                    Log in
                  </Button>
                </Box>
              </Box>
            );
          }}
        </Formik>
      </Box>
    </div>
  );
};
export default Index;
